                  }}
                >
                  {" "}
                  UPLOAD
                </button>
              </div>
            </div>
            <div className="card box_outside">
              <img
                src="https://cdn-icons-png.flaticon.com/128/8078/8078936.png"
                className="card-img-scrapdetail"
                alt="..."
              />
              <div className="card-body">
                <p className="card-text">
                  Fridge <br /> 1100/piece
                </p>
                <button
