                className="card-img-scrapdetail"
                alt="..."
              />
              <div className="card-body">
                <p className="card-text">
                  Ceiling Fan <br /> 40/kg
                </p>
                <button
                  className="btn btn-success"
                  onClick={(event) => {
                    setOrderDetails({
                      ...orderDetails,
